    return ( <div>

  <img className="img-dialogs" src="https://i.ibb.co/qkdRLJQ/55018-cifrovoe-iskusstvo-krasivaja-devushka-v-gorod-nochju-marki-raid-lechenija-cb07-komnata-doma-st.jpg" alt="" />



  <div className={s.dialogs}>

   {  messagesElements }

